import { Component } from "@angular/core";

import { AuthService } from "../services/auth.service";
import { Observable, shareReplay } from "rxjs";
import { SharedService } from "../services/shared.service";

@Component({
  selector: "app-header",
  templateUrl: "./header.component.html",
  styleUrls: ["./header.component.scss"],
})
export class HeaderComponent {
  textHeader!: string;
  isAuth$!: Observable<boolean>;
  userRole$!: Observable<number | null>;
  userName$!: Observable<string | null>;

  constructor(private auth: AuthService, private shareService: SharedService) {}

  ngOnInit() {
    this.isAuth$ = this.auth.isAuth$.pipe(shareReplay(1));
    this.userRole$ = this.auth.userRole$;
    this.userName$ = this.auth.userName$;
    console.log(
      "voici les données utilsateur :",
      this.userName$,
      this.userRole$,
      this.isAuth$
    );
    this.shareService.getTextHeader().subscribe((text) => {
      this.textHeader = text;
    });
  }

  onLogout() {
    this.auth.logout();
  }
}
<div class="app-header">
  <img
    *ngIf="(isAuth$ | async) && (userRole$ | async) !== 2"
    src="../../assets/Logo_Konect.png"
    class="app-header_logo"
  />
  <img
    *ngIf="(isAuth$ | async) && (userRole$ | async) === 2"
    src="../../assets/Logo Kare.png"
    class="app-header_logo"
  />
  <div class="app-header_title" *ngIf="isAuth$ | async">
    <p>{{ textHeader }}</p>
  </div>
  <button class="logout_button" *ngIf="isAuth$ | async" (click)="onLogout()">
    Déconnexion
  </button>
  <nav>
    <div
      class="right-nav"
      *ngIf="(isAuth$ | async) && (userRole$ | async) !== 2"
    >
      <ul>
        <li>
          <a routerLink="dietbooks" routerLinkActive="activeMenu">Diet</a>
        </li>
        <li>
          <a routerLink="recipebooks" routerLinkActive="activeMenu">Recette</a>
        </li>
        <li>
          <a routerLink="sportbooks" routerLinkActive="activeMenu">Sport</a>
        </li>
      </ul>
    </div>
  </nav>
</div>
